7.1%* : sucre, sirop de glucose de blé, crème  24%, beurre 20%, Demi-boule en chocolat blanc 12.5%*, sucre, beurre de cacao, lait entier en poudre, arôme naturel de vanille, colorant : oxyde et hydroxyde de fer. *Pourcentages exprimés sur le décor.', 'https://static.openfoodfacts.org/images/products/336/895/266/0015/front.6.400.jpg', '9.78', '5.08', '28.76', '23.88', '0.38', '2.44', '0.1524', '0.06', '', '1');

